(*
 * This is the ancillary file to arXiv:2001.03008
 *
 * Authors: M. Czakon, M. Niggetiedt
 *
 * Functions:
 *
 * CI[z_?NumericQ, nl_, Lmu_]
 * CZ[z_?NumericQ, nl_, Lmu_]
 *
 * C0, C1I, C2I evaluated at Lmu = 0 :
 *
 * C0[z_?NumericQ]
 * C1I[z_?NumericQ]
 * C2I[z_?NumericQ, nl_]
 *
 * Large-mass (LME), threshold (THR) and high-energy (HE) expansions evaluated
 * at Lmu = 0 and split into nl^0 and nl^1 contributions :
 *
 * C2ILMEnl0[z_?NumericQ]
 * C2ILMEnl1[z_?NumericQ]
 * C2ITHRnl0[z_?NumericQ]
 * C2ITHRnl1[z_?NumericQ]
 * C2IHEnl0[z_?NumericQ]
 * C2IHEnl1[z_?NumericQ]
 *
 * Interpolation table for the range of z values not covered between the
 * threshold and high-energy expansions :
 *
 * C2ITABnl0[z_?NumericQ]
 * C2ITABnl1[z_?NumericQ]
 *
 * High-order analytic large-mass expansion evaluated at Lmu = 0 :
 *
 * C2ILME
 *
 * Variables:
 *
 * api = alphas/Pi
 * z   = s/(4*M^2)
 * t   = Sqrt[1-z-i0+]
 * Ls  = Log[-s/M^2-i0+]
 * Lt  = Log[1-z-i0+]
 * Lmu = Log[-mu^2/(s+i0+)]
 * nl  - number of massless quark flavors
 *)

b0 = (11*CA)/3 - (4*nl*TF)/3;

b1 = (34*CA^2)/3 - (20*CA*nl*TF)/3 - 4*CF*nl*TF;

GaugeGroupConstants = {CA -> 3, CF -> 4/3, TF -> 1/2};

CI[z_?NumericQ, nl_, Lmu_] :=
    Normal[Series[C0[z]*(1 + api*(b0/4)*Lmu + api^2*((b1 + b0^2*Lmu)/16)*
           Lmu) + api*C1I[z]*(1 + api*(b0/2)*Lmu) + api^2*C2I[z, nl],
       {api, 0, 2}]] /. GaugeGroupConstants

CItoCZ = 1 + api*(-(CA*Lmu^2)/4 + (CA*Pi^2)/24 +
       Lmu*((-11*CA)/12 + (nl*TF)/3)) +
     api^2*((CA^2*Lmu^4)/32 - (nl^2*Pi^2*TF^2)/216 +
       Lmu^3*((11*CA^2)/72 - (CA*nl*TF)/18) +
       Lmu^2*(CA^2*(-67/144 + Pi^2/96) + (5*CA*nl*TF)/36) +
       Lmu*(nl*(CF/4 + CA*(16/27 - Pi^2/72))*TF +
         CA^2*(-173/108 + (11*Pi^2)/288 + Zeta[3]/8)) +
       CA^2*(-Pi^2/64 - (11*Zeta[3])/96) + CA*nl*TF*((17*Pi^2)/864 +
         Zeta[3]/24))

CZ[z_?NumericQ, nl_, Lmu_] := Normal[Series[CItoCZ*CI[z, nl, Lmu],
      {api, 0, 2}]] /. GaugeGroupConstants

C0[z_?NumericQ] := (1/(2*z))*
     (1 - (1 - 1/z)*((1/2)*Log[(Sqrt[1 - 1/z] - 1)/(Sqrt[1 - 1/z] + 1)])^2)

C1I[z_?NumericQ] := -((47*x)/(3*(-1 + x)^2)) +
      (Pi^4*x*(-1 - x + 3*x^2 + 3*x^3))/(15*(-1 + x)^5) +
      (12*x*(1 + x)^2*HPLNum[{1, 0, -1, 0}, x])/(-1 + x)^4 +
      ((x*(3 + 22*x + 3*x^2))/(4*(-1 + x)^4) +
        (Pi^2*x*(-1 - x + 17*x^2 + 17*x^3))/(36*(-1 + x)^5) +
        (x*(47 + 66*x + 47*x^2)*Log[1 - x])/(6*(-1 + x)^4))*Log[x]^2 +
      (-((x*(6 + 59*x + 58*x^2 + 33*x^3))/(18*(-1 + x)^5)) +
        (x*(1 + x)^2*Log[1 - x])/(-1 + x)^4)*Log[x]^3 +
      (x*(-5 - 5*x + 13*x^2 + 13*x^3)*Log[x]^4)/(144*(-1 + x)^5) +
      ((16*x*(1 + x)^2*Log[x])/(3*(-1 + x)^4) +
        (8*x*(1 + x + x^2 + x^3)*Log[x]^2)/(3*(-1 + x)^5))*PolyLog[2, -x] +
      (-((Pi^2*x*(1 + x)^2)/(-1 + x)^4) + (x*(51 + 74*x + 51*x^2)*Log[x])/
         (3*(-1 + x)^4) + (x*(5 + 5*x + 23*x^2 + 23*x^3)*Log[x]^2)/
         (3*(-1 + x)^5))*PolyLog[2, x] +
      (-((32*x*(1 + x)^2)/(3*(-1 + x)^4)) - (2*x*(1 + x)*(23 + 41*x^2)*
          Log[x])/(3*(-1 + x)^5))*PolyLog[3, -x] +
      (-((x*(55 + 82*x + 55*x^2))/(3*(-1 + x)^4)) -
        (2*x*(1 + x)*(23 + 41*x^2)*Log[x])/(3*(-1 + x)^5))*PolyLog[3, x] +
      (6*x*(5 + 5*x + 11*x^2 + 11*x^3)*PolyLog[4, -x])/(-1 + x)^5 +
      (6*x*(5 + 5*x + 7*x^2 + 7*x^3)*PolyLog[4, x])/(-1 + x)^5 +
      (x*(31 + 34*x + 31*x^2)*Zeta[3])/(3*(-1 + x)^4) -
      (18*x*(1 + x)^2*Log[1 - x]*Zeta[3])/(-1 + x)^4 +
      Log[x]*((4*x*(1 + x))/(-1 + x)^3 - (2*Pi^2*x*(1 + x)^2)/
         (9*(-1 + x)^4) - (Pi^2*x*(1 + x)^2*Log[1 - x])/(-1 + x)^4 +
        (x*(-11 - 11*x + 43*x^2 + 43*x^3)*Zeta[3])/(3*(-1 + x)^5)) /.
     x -> (Sqrt[1 - 1/z] - 1)/(Sqrt[1 - 1/z] + 1)

HPLNum[{1, 0, -1, 0}, x_?NumericQ] :=
    NIntegrate[(2*PolyLog[3, -t] - PolyLog[2, -t]*Log[t])/(1 - t), {t, 0, x}]

C2I[z_?NumericQ, nl_] := Module[{x = z/(4 + z)},
     Which[x < 1/6, C2ILMEnl0[z] + nl*C2ILMEnl1[z], x < 1/4,
       C2ITHRnl0[z] + nl*C2ITHRnl1[z], x < 3/4, C2ITABnl0[z] +
        nl*C2ITABnl1[z], True, C2IHEnl0[z] + nl*C2IHEnl1[z]] +
      nl^2*(Pi^2/864)*C0[z]]

C2ILMEnl0[Z_?NumericQ] := auxC2ILMEnl0 /. {z -> Z, Ls -> Log[4*Z] - I*Pi}
C2ILMEnl1[Z_?NumericQ] := auxC2ILMEnl1 /. {z -> Z, Ls -> Log[4*Z] - I*Pi}
C2ITHRnl0[Z_?NumericQ] := auxC2ITHRnl0 /. {t  :> If[Z < 1, Sqrt[1 - Z], -I*Sqrt[Z - 1]],
                                           Lt :> Which[Z < 1, Log[1 - Z], Z == 1, 0, True, Log[Z - 1] - I*Pi]}
C2ITHRnl1[Z_?NumericQ] := auxC2ITHRnl1 /. {t  :> If[Z < 1, Sqrt[1 - Z], -I*Sqrt[Z - 1]],
                                           Lt :> Which[Z < 1, Log[1 - Z], Z == 1, 0, True, Log[Z - 1] - I*Pi]}
C2ITABnl0[Z_?NumericQ] := Interpolation[auxC2ITABnl0][Z/(4+Z)];
C2ITABnl1[Z_?NumericQ] := Interpolation[auxC2ITABnl1][Z/(4+Z)];
C2IHEnl0[Z_?NumericQ] := auxC2IHEnl0 /. {z -> Z, Ls -> Log[4*Z] - I*Pi}
C2IHEnl1[Z_?NumericQ] := auxC2IHEnl1 /. {z -> Z, Ls -> Log[4*Z] - I*Pi}

